Part 3 of our behind the scenes look at the @brailleorigins mobile game. This episode looks into how we use video as the main gameplay driver and why it’s so innovative in mobile gaming.

Download “Braille Skateboard Origins” for free on the App Stores today!

@sessiongames #skateboarding #mobilegames

@aaronkyro and @rickyglaser did 1,000 kickflips to wear test the new Braille First Try shoes. Full video on the Braille Skate YouTube channel. Will the shoes survive 1,000 kickflips without blowing out?

⚠️ SPOILER ALERT: They survive and with plenty of toe to spare!

New navy and burgundy colors now available at www.brailleskateboarding.com
